// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract VickreyAuction is ReentrancyGuard {
    address public owner;
    uint public startTime;
    uint public endTime;
    uint public maxPrice;
    uint public paymentAmount;
    address public winner;
    bool public auctionEnded;
    bool public deliveryConfirmed;
    bool public deliveryFailed;

    struct Bid {
        uint amount;
        uint deposit;
        uint timestamp;
    }

    mapping(address => Bid) public bids;
    address[] public participants;

    event AuctionFinalized(address winner, uint payment);
    event DeliveryConfirmed(address winner, uint payment, uint deposit);
    event DeliveryFailed(address winner, uint payment, uint deposit);
    event FundsWithdrawn(address owner, uint amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this");
        _;
    }

    modifier auctionActive() {
        require(block.timestamp >= startTime && block.timestamp <= endTime, "Auction not active");
        require(!auctionEnded, "Auction already ended");
        _;
    }

    constructor(uint _startTime, uint _endTime, uint _maxPrice) payable {
        require(_startTime < _endTime, "Invalid dates");
        require(msg.value == _maxPrice, "Max deposit required");
        owner = msg.sender;
        startTime = _startTime;
        endTime = _endTime;
        maxPrice = _maxPrice;
    }

    function bid(uint _amount) external payable auctionActive {
        require(msg.sender != owner, "Owner cannot bid"); // <-- Correzione aggiunta qui
        require(_amount > 0 && _amount <= maxPrice, "Invalid amount");
        require(bids[msg.sender].amount == 0, "Already participated");
        require(participants.length < 30, "Max bids reached");
        require(msg.value >= (_amount * 10) / 100, "Insufficient deposit");

        bids[msg.sender] = Bid(_amount, msg.value, block.timestamp);
        participants.push(msg.sender);
    }

    function finalizeAuction() external onlyOwner nonReentrant {
        require(block.timestamp > endTime || participants.length >= 30, "Auction still active");
        require(!auctionEnded, "Auction already finalized");

        auctionEnded = true;
        if (participants.length == 0) return;

        // Sort bids ascending (lowest first)
        address[] memory sorted = participants;
        for (uint i = 0; i < sorted.length - 1; i++) {
            for (uint j = i + 1; j < sorted.length; j++) {
                Bid memory a = bids[sorted[i]];
                Bid memory b = bids[sorted[j]];
                if (a.amount > b.amount || (a.amount == b.amount && a.timestamp > b.timestamp)) {
                    (sorted[i], sorted[j]) = (sorted[j], sorted[i]);
                }
            }
        }

        winner = sorted[0];
        paymentAmount = participants.length > 1 ? bids[sorted[1]].amount : bids[winner].amount;

        // Clear participants
        delete participants;

        // Refund losers
        for (uint i = 0; i < sorted.length; i++) {
            address bidder = sorted[i];
            if (bidder != winner) {
                uint deposit = bids[bidder].deposit;
                bids[bidder].deposit = 0; // prevent reentrancy
                payable(bidder).transfer(deposit);
            }
        }

        emit AuctionFinalized(winner, paymentAmount);
    }

    function confirmDelivery() external onlyOwner nonReentrant {
        require(auctionEnded, "Auction not ended");
        require(!deliveryConfirmed && !deliveryFailed, "Delivery already processed");

        deliveryConfirmed = true;
        uint deposit = bids[winner].deposit;
        bids[winner].deposit = 0;

        payable(winner).transfer(paymentAmount + deposit);
        emit DeliveryConfirmed(winner, paymentAmount, deposit);
    }

    function markAsUndelivered() external onlyOwner nonReentrant {
        require(auctionEnded, "Auction not ended");
        require(!deliveryConfirmed && !deliveryFailed, "Delivery already processed");

        deliveryFailed = true;
        uint deposit = bids[winner].deposit;
        bids[winner].deposit = 0;

        payable(owner).transfer(paymentAmount + deposit);
        emit DeliveryFailed(winner, paymentAmount, deposit);
    }

    function getBids() external view onlyOwner returns (address[] memory, uint[] memory) {
        uint[] memory amounts = new uint[](participants.length);
        for (uint i = 0; i < participants.length; i++) {
            amounts[i] = bids[participants[i]].amount;
        }
        return (participants, amounts);
    }

    function withdrawRemaining() external onlyOwner nonReentrant {
        require(auctionEnded, "Auction must be finalized");
        require(address(this).balance > 0, "No funds available");
        require(winner == address(0) || deliveryConfirmed || deliveryFailed, "Awaiting delivery confirmation");

        uint amount = address(this).balance;
        payable(owner).transfer(amount);
        emit FundsWithdrawn(owner, amount);
    }
}

